            style={
                styles.btnEntrar
            }
            onPress={() => navigation.navigate('home')}
            >
                <Text style={styles.txtEntrar}>{textButton}</Text>
            </TouchableOpacity>
            </View>
            
            
            
        </View>
    );
}
